        "    def __len__(self):\n",
        "        return len(self.X)\n",
        "\n",
        "    def __getitem__(self, idx):\n",
        "        img = torch.tensor(self.X[idx], dtype=torch.float32).permute(2,0,1)  # (4,240,240)\n",
        "        mask = torch.tensor(self.Y[idx], dtype=torch.long)                  # (240,240)\n",
        "        return img, mask\n",
