        "epochs = 50  # recommended range: 50–100\n",
        "\n",
        "print(\"\\nTraining improved autoencoder...\\n\")\n",
        "\n",
        "for epoch in range(epochs):\n",
        "    ae.train()\n",
        "    total = 0\n",
        "\n",
