        "\n",
        "        loss = loss_fn(y_hat, y_oh)\n",
        "        loss.backward()\n",
        "        optimizer.step()\n",
        "\n",
        "        total += loss.item()\n",
        "\n",
        "    print(f\"Epoch {epoch+1}/{epochs} | Loss = {total/len(Y_clean):.5f}\")\n"
