        "\n",
        "import matplotlib.pyplot as plt\n",
        "\n",
        "def overlay_mask_on_gray(mask, alpha=0.35):\n",
        "    H, W = mask.shape\n",
        "    base = np.zeros((H, W, 3), dtype=float)\n",
        "\n",
        "    base[:,:,0] = 0.4  # dark background\n",
        "\n",
        "    overlay = np.zeros_like(base)\n",
        "    overlay[mask == 1] = [0,1,0]   # edema\n",
        "    overlay[mask == 2] = [1,1,0]   # enhancing\n",
        "\n",
        "    return base*(1-alpha) + overlay*alpha\n",
        "\n",
        "def visualize_unet_result(idx):\n",
        "    gt = gt_masks[idx]\n",
        "    pred = pred_masks[idx]\n",
        "\n",
        "    ov_gt   = overlay_mask_on_gray(gt)\n",
        "    ov_pred = overlay_mask_on_gray(pred)\n",
