        "    plt.figure(figsize=(12,4))\n",
        "\n",
        "    plt.subplot(1,3,1)\n",
        "    plt.imshow(gt, cmap=\"viridis\")\n",
        "    plt.title(\"Ground Truth\")\n",
        "    plt.axis(\"off\")\n",
        "\n",
        "    plt.subplot(1,3,2)\n",
        "    plt.imshow(pred, cmap=\"viridis\")\n",
        "    plt.title(\"Prediction\")\n",
        "    plt.axis(\"off\")\n",
        "\n",
        "    plt.subplot(1,3,3)\n",
        "    plt.imshow(ov_pred)\n",
        "    plt.title(\"Overlay (Predicted)\")\n",
        "    plt.axis(\"off\")\n",
